import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import SwitchBtn from './components/switchBtn/switchBtn.js';
import Grid from '@material-ui/core/Grid';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';

import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemSecondaryAction from '@material-ui/core/ListItemSecondaryAction';
import ListItemText from '@material-ui/core/ListItemText';
import ListSubheader from '@material-ui/core/ListSubheader';
import Switch from '@material-ui/core/Switch';
import WifiIcon from '@material-ui/icons/Wifi';
import AccessibilityNew from '@material-ui/icons/AccessibilityNew';
class App extends Component {
  constructor(props){
    super(props);
    this.state = {

    }
  }

  render() {
    return (
      <div className="App">
        <List subheader={<ListSubheader>Lights</ListSubheader>}>
        <ListItem>
          <ListItemIcon>
            <WifiIcon />
          </ListItemIcon>
          <ListItemText primary="Rauchen?" />
          <ListItemSecondaryAction>
            <SwitchBtn light={0}/>
          </ListItemSecondaryAction>
        </ListItem>

        <ListItem>
          <ListItemIcon>
            <WifiIcon />
          </ListItemIcon>
          <ListItemText primary="Hunger?" />
          <ListItemSecondaryAction>
            <SwitchBtn light={1}/>
          </ListItemSecondaryAction>
        </ListItem>

          <ListItem>
            <ListItemIcon>
              <WifiIcon />
            </ListItemIcon>
            <ListItemText primary="Käffchen/Teechen" />
            <ListItemSecondaryAction>
              <SwitchBtn light={2}/>
            </ListItemSecondaryAction>
          </ListItem>

          <ListItem>
            <ListItemIcon>
              <BluetoothIcon />
            </ListItemIcon>
            <ListItemText primary="Bin in der Küche, habt mich lieb." />
            <ListItemSecondaryAction>
              <SwitchBtn light={3}/>
            </ListItemSecondaryAction>
          </ListItem>

        </List>
      </div>
    );
  }
}

export default App;
